import ExpenseItem from "./ExpenseItem";

function Expenses(props) {
  const ExpenseItems = [];
  for (let expense of props.expenses) {
    ExpenseItems.push(<ExpenseItem expense={expense}></ExpenseItem>);
  }
}

export default Expenses;
